    return (
        <div>
            <div className='settings'>
                Game Settings
                <form> 
                    


                </form>
            </div>




 

            <h2> Number of rows: min 5</h2>
            <h3> Number of columns: min 5</h3>

            

            <Link to='/game' onClick={() => onSettingChange(setting)}> GO TO GAME </Link>

        </div>
    )
}

